                    "title": "Exclusion Criteria",
                    "content": "Subjects will be excluded from study enrollment if they meet any of the following criteria at screening and/or enrollment (Day 1):  \r\n\r\n \r\n\r\n[8] are investigator site personnel directly affiliated with this study and their immediate families. Immediate family is defined as a spouse, parent, child or sibling, whether biological or legally adopted.  \r\n\r\n \r\n\r\n[9] are Lilly or Covance employees.  \r\n\r\n \r\n\r\n[10] are currently enrolled in a clinical study involving an investigational product or any other type of medical research judged not to be scientifically or medically compatible with this study.  \r\n\r\n \r\n\r\n[11] have known allergies to lasmiditan, related compounds, or any components of the formulation.  \r\n\r\n \r\n\r\n[12] are persons who have previously received lasmiditan.  \r\n\r\n \r\n\r\n[13] have a history of, or ECG findings of, clinically significant bradycardia, heart block, tachy or brady arrhythmias, or have any other abnormality in the 12-lead ECG that, in the opinion of the investigator, increases the risks associated with participating in the study.  \r\n\r\n \r\n\r\n[14] have significant history of or current cardiovascular, respiratory, hepatic, renal, gastrointestinal, endocrine, hematological, or neurological disorders capable of significantly altering the absorption, metabolism, or elimination of drugs; of constituting a risk when taking the study medication; or of interfering with the interpretation of data. Appendectomy, splenectomy, and cholecystectomy are considered as acceptable.  \r\n\r\n \r\n\r\n[15] show evidence of significant active neuropsychiatric disease (e.g. manic depressive illness, schizophrenia, depression) considered as clinically significant by the investigator.  \r\n\r\n \r\n\r\n[16] show a history of central nervous system (CNS) conditions such as strokes, transient ischemic attacks, significant head trauma, seizures, CNS infections, migraines, brain surgery, or any other neurological conditions that, in the opinion of the investigator, increase the risk of participating in the study.  \r\n\r\n \r\n\r\n[17] show evidence of active renal disease (e.g. diabetic renal disease, polycystic kidney disease) or estimated glomerular filtration rate  < 60 mL/min/1.73 mÂ².  \r\n\r\n \r\n\r\n[18] currently use, or within the past 1 year used recreational drug use, or showed evidence of substance dependence within the past 6 months based on history at screening visit.  \r\n\r\n \r\n\r\n[19] show evidence of human immunodeficiency virus (HIV) infection and/or positive human HIV antibodies/antigens.  \r\n\r\n \r\n\r\n[20] show evidence of hepatitis C and/or positive hepatitis C antibody.  \r\n\r\n \r\n\r\n[21] show evidence of hepatitis B and/or positive hepatitis B surface antigen.  \r\n\r\n \r\n\r\n[22] intend to use over-the-counter or prescription medication, dietary supplements, or strong inhibitors or inducers of cytochrome P450 (CYP) 1A and CYP3A activities within 14 days prior to dosing of lasmiditan. Exceptions allowable for subjects on a stable dose of hormone replacement therapy, thyroid replacement therapy, prophylactic anti-platelet drugs, angiotensin-converting enzyme (ACE) inhibitors, angiotensin receptor blockers (ARBs), thiazides, statins, or protein pump inhibitors (PPIs) for at least 3 months prior to admission; medications falling into the exceptions listed above, and/or others that may be considered not to impact study integrity may be allowed following discussion with the Lilly clinical research physician (CRP)/CP or designee.  \r\n\r\n \r\n\r\n[23] have donated blood of more than 500 mL within 2 months prior to the screening visit.  \r\n\r\n \r\n\r\n[24] have an average weekly alcohol intake that exceeds 14 units per week or are unwilling to stop alcohol consumption 48 hours prior to admission until the completion of the study (1 unit = 12 OZ or 360 mL of beer; 5 OZ or 150 mL of wine;  \r\n\r\n \r\n\r\n\t1.5 OZ or 45 mL of distilled spirits).  \r\n\r\n \r\n\r\n[25] have a history of syncope, presyncopy, uncontrolled vertigo, postural dizziness, or at risk for falls, as judged to be clinically significant by the investigator.  \r\n\r\n \r\n\r\n[26] are unwilling to refrain from tobacco- or nicotine-containing products while in the CRU or are unable to abide by CRU restrictions.  \r\n\r\n \r\n\r\n[27] have orthostatic hypotension with or without dizziness and/or syncope at screening (or upon repeat) or a history of it.  \r\n\r\n \r\n\r\n[28] have a history of, show evidence of, or are undergoing treatment for significant active neuropsychiatric disease (e.g. manic depressive illness, schizophrenia, depression), have a recent history of a suicide attempt (30 days within screening visit and any time between screening visit and baseline); or are clinically judged by the investigator to be at risk for suicide.  \r\n\r\n \r\n\r\n[29] in the opinion of the investigator or sponsor, are unsuitable for inclusion in the study.",
